package medium;
import static org.junit.Assert.*;
import medium.NumDecodings;

import org.junit.Test;


public class NumDecodingsTest {

	@Test
	public final void test() {
		assertEquals(2, NumDecodings.numDecodings("12"));
	}
	@Test
	public final void test1() {
		assertEquals(1, NumDecodings.numDecodings(""));
	}
	
	@Test
	public final void test2() {
		assertEquals(0, NumDecodings.numDecodings("0"));
	}
	
	@Test
	public final void test3() {
		assertEquals(2, NumDecodings.numDecodings("17"));
	}
}
